		// Overriding Backbone's sync method. Replace the default RESTful services-based implementation
		// with a simple in-memory approach.
		Backbone.sync = function (method, model, options) {
		
		    var resp;
		
		    switch (method) {
		        case "read":
		            resp = model.id ? localStore.find(model) : localStore.findAll();
		            break;
		        case "create":
		            resp = localStore.create(model);
		            break;
		        case "update":
		            resp = localStore.update(model);
		            break;
		        case "delete":
		            resp = localStore.destroy(model);
		            break;
		    }
		
		    if (resp) {
		        options.success(resp);
		    } else {
		        options.error("Record not found");
		    }
		};
